import React from "react";
import Notes from "./Note";

function Note() {
  return (
    <div className="note">
      {Notes.map((props) => (
        <Entry key={props.key} nTitle={props.title} nContent={props.content} />
      ))}
    </div>
  );
}

export default Note;
